const useStyles = theme => ({
  root: {
    flexGrow: 1,
    top: 0,
    height: "10vh",
    shadow: "inset 0 -0.1em 0.1em rgba(0, 0, 0, 0.25), inset 0 0.2em 0.2em rgba(0, 0, 0, 0.25)",
    backgroundColor: "red",
  },
});

export default useStyles;
